import React, {useState } from 'react'
import TinderCard from 'react-tinder-card'


function TinderCards() {
    const [people, setPeople] = useState ([
      {
        name: 'Sarah A',
        url: 
          "https://singapore-grlk5lagedl.stackpathdns.com/production/singapore/images/1609827493259134-modelo.jpg?w=1920&h=800&fit=fill&crop=faces&auto=%5B%22format%22%2C%20%22compress%22%5D&cs=srgb"
      },
      {
        name: 'Alyssa B',
        url: 
          "https://lh3.googleusercontent.com/proxy/rg6jKvE63gKtcZgSsXEy5aYBa7S0_T5x3u9vAMeslLGYdPDYSYRibRVYkWlvv5QL1KYYxDFEnxZA2cuMiKdDCme2-5glMeFnyu0cVL-odGRl_iBF1yuIrk-d8BDGpssC2We1rA"
      },
    ]);

    return (
      <div>
        <h1>Elike cards</h1>

        {people.map((person) => ( 
          <TinderCard
            className="swipe"
            key={person.name}
            preventSwipe={['up', 'down']}
          >
            <div 
              style= {{ backgroundImage: 'url(${person.url})' }}
              className="card"
            >
              <h3>{person.name}</h3>
            </div>
          </TinderCard>
        ))}
      </div>
    );
}

export default TinderCards;
